@PauloArana @mimimidias O oposto: quando citam não há relação direta com o tema, e quando há, é para acusar a banda de ser "mainstream" no gênero

Sério, eu que não sou da cena BM estou revoltado e com uma vergonha alheia do caralho dos brasileigos, pqp

Até gente da esquerda e underground metendo essa

@PauloArana @mimimidias Me perdi novamente, mas volto: 

Achei que Lords or Chaos trata superficialmente do tema de extremismo político de direita e sua influência e infiltração no black metal

Especificamente sobre nazismo e supremacismo há pouca coisa. E li uns 2 ou 3 que eram pobres no tema tb

@PauloArana @mimimidias Ou achar o disco do Nick Cave Murder Ballads fodão, um disco de baladas tradicionais de assasinatos de mulheres, e não ser um psicopata feminicida

E ele é fodão exatamente por ser sobre isso, e não apesar disso

Temas mórbidos podem ser elevados a arte se o cara tem a manha

@PauloArana @mimimidias Aproveitando, isso aqui é simplesmente vergonhoso para o Brasil, para a ESQUERDA que pressionou por impedir uma manifestação artística legítima UNDERGROUND de uma banda clássica e seminal que não tem histórico de cancelamento por política 

Vergonhoso

https://t.co/f1yT1tS2cI

@PauloArana @mimimidias Eu achei muito bom, pois curto vários estilos de musica e rock, e apesar de não ser conhecedor profundo de metal, gosto de me informar sobre cenas musicais bizarras

E gosto de ler sobre política em geral

Masssss, achei fraca a exploração da temática política....

@PauloArana @mimimidias E não é só uma banda de 40 ANOS DE ESTRADA, é simplesmente uma banda CLÁSSICA e SEMINAL de um gênero não popular, mas conhecido. 

Milhares de coisas já escritas e analisadas sobre eles, reviews de disco e a porra toda

Onde está a pesquisa, análise e documentação sobre eles ?

@PauloArana @mimimidias Nessa polêmica do Mayhem, em todo lugar que olho, são sempre as mesmas 5 ou 6 declarações racistas de membros de forma pessoal, e umas 2 ou 3 performances ARTÍSTICAS no palco COMO BANDA com parafernália nazi

UMA BANDA DE FUCKING 40 ANOS de carreira

As pessoas surtaram, pqp

@PauloArana @mimimidias @tavosmm Um ponto que é bem curioso sobre o livro Lords of Chaos é que o autor, Michael Moynihan, é provavelmente um fascista mais sofisticado (ou confuso) e produtivo que toda a cena black metal que ele conta no livro 

Colaborou como Douglas P.,o pai do Neo Folk

